== Images ==

The image of a young, dark-haired male sitting in quality northern Albanian clothing is obviously not of Sokol Baci. This person [http://www.digitalna.nb.rs/wb/NBS/Fotodokumenta/Album/Cetinje/AF_054?pageIndex=00045 wears Montenegrin clothing here]. He is a member of the nobility, the Cyrillic script saying "K/N...ević". The photos date to much later than 1876, perhaps closer to 1900. The two individuals are not resembling eachother. I have found an image of Sokol Baci which seems to have been taken after his arrival in Montenegro, see [[:File:Sokol_Baci_Ivezić.jpg|here]].--[[User_talk:Zoupan|Z<small>oupan</small>]] 00:34, 29 November 2015 (UTC)

The young dark haired individual is Sokol Baci. You can see that he has the same "Ottoman weapons"  in  both the younger photo and the photo  that you added when he immigrated to Montenegro.  You can see that the pattern of his jacket and pants is the same. He also has the same facial structure, granted he has aged in the 2nd photo.  [[User:Simon Ivezaj|Simon Ivezaj]] ([[User talk:Simon Ivezaj|talk]]) 03:12, 29 November 2015 (UTC)

There is a possibility that these are photos of Sokol in the mid 1880's rather than 1876? there are a couple of other  images of the young dark haired man in Albanian clothing(standing up) I can upload them to this talk page tomorrow for you to view.  [[User:Simon Ivezaj|Simon Ivezaj]] ([[User talk:Simon Ivezaj|talk]]) 04:05, 29 November 2015 (UTC)

